import React from 'react';

const LostFoundForm = () => {
  const centerStyle = {
    display: 'flex',
    justifyContent: 'center',
    //alignItems: 'center',
    textAlign: 'center',
    marginBottom: '40px',
  };

  const rowfirst = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    flexWrap: 'wrap',
    marginTop: '20px',
  };

  const columnfirst = {
    flex: '1',
    padding: '20px',
  };

  const formCard = {
    backgroundColor: '#f4f4f4',
    borderRadius: '8px',
    padding: '20px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    textAlign: 'left',
    maxWidth: '500px',
  };

  const formTitle = {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    marginBottom: '10px',
  };

  const formGroup = {
    marginBottom: '20px',
  };

  const labelStyle = {
    fontWeight: 'bold',
    marginBottom: '8px',
    display: 'block',
  };

  const inputStyle = {
    width: '100%',
    padding: '12px',
    borderRadius: '8px',
    border: '1px solid #ccc',
    transition: 'border-color 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
  };

  const buttonStyle = {
    padding: '14px 26px',
    borderRadius: '8px',
    border: 'none',
    backgroundColor: '#007bff',
    color: '#fff',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease-in-out, transform 0.2s ease-in-out',
  };

  const imageStyle1 = {
    width: '100%',
    maxWidth: '400px',
    borderRadius: '8px',
  };

  return (
    <div>
      <div style={centerStyle}>
        <div>
          <h2>Report a Lost Item</h2>
        </div>
      </div>

      <div style={rowfirst}>
        {/* Left Column with Form */}
        <div style={columnfirst}>
          <div style={formCard}>
            <h5 style={formTitle}>Lost Item Report</h5>
            <form id="lostItemForm">
              <div style={formGroup}>
                <label style={labelStyle} htmlFor="personName">Your Name:</label>
                <input
                  style={inputStyle}
                  type="text"
                  id="personName"
                  name="personName"
                  required
                />
              </div>

              <div style={formGroup}>
                <label style={labelStyle} htmlFor="gmailId">Gmail ID:</label>
                <input
                  style={inputStyle}
                  type="email"
                  id="gmailId"
                  name="gmailId"
                  required
                />
              </div>

              <div style={formGroup}>
                <label style={labelStyle} htmlFor="contactNo">Contact Number:</label>
                <input
                  style={inputStyle}
                  type="tel"
                  id="contactNo"
                  name="contactNo"
                  required
                />
              </div>

              <div style={formGroup}>
                <label style={labelStyle} htmlFor="location">Where It Was Lost:</label>
                <input
                  style={inputStyle}
                  type="text"
                  id="location"
                  name="location"
                  required
                />
              </div>

              <div style={formGroup}>
                <label style={labelStyle} htmlFor="lostItemName">Lost Item:</label>
                <input
                  style={inputStyle}
                  type="text"
                  id="lostItemName"
                  name="lostItemName"
                  required
                />
              </div>

              <div style={formGroup}>
                <label style={labelStyle} htmlFor="description">Description:</label>
                <textarea
                  style={inputStyle}
                  id="description"
                  name="description"
                  required
                ></textarea>
              </div>

              <div style={formGroup}>
                <label style={labelStyle} htmlFor="dateLost">Date When Lost:</label>
                <input
                  style={inputStyle}
                  type="date"
                  id="dateLost"
                  name="dateLost"
                  required
                />
              </div>

              <button type="submit" style={buttonStyle}>
                Submit
              </button>
            </form>
          </div>
        </div>

        {/* Right Column with Image */}
        <div style={columnfirst}>
          <img
            src="images/lost-card.png"
            alt="Lost and Found"
            style={imageStyle1}
          />
        </div>
      </div>
    </div>
  );
};

export default LostFoundForm;
